import React from "react";
import { Container, Row } from "react-bootstrap";

const Contact = () => {
  return (
    <div id="Contact">
      <div className="box">
        <Container>
          <Row></Row>
        </Container>
      </div>
    </div>
  );
};

export default Contact;
